#In this file the accuracy distribtuion graphs for the three algorithms - RF, LR & SVM are plotted for 2000 random seeds.
#Import Statements
import numpy as np
import seaborn as sns
from scipy.stats import stats
import matplotlib.pyplot as plt

# Function to plot the distribution of the accuracy scores, this takes as parameters the name of the model|
#the accuracy  values of  the three models and the title
def generate_density_plot(title, rf_acc, lr, svm):
    #if there are no more rf accuracy values stop
    if len(rf_acc) < 1:
        return
    #Function to plot probability distribution function
    def plot_pdf():
        #Use Seaborn distribution plot function to plot the distribution of Accuracy scores for RF
        sns.distplot(rf_acc, hist=False, kde=True, kde_kws={'linewidth': 1}, label='RF')
        #Use Seaborn distribution plot function to plot the distribution of Accuracy scores For LR
        sns.distplot(lr, hist=False, kde=True, kde_kws={'linewidth': 1}, label='LR')
        #Use Seaborn distribution plot function to plot the distribution of Accuracy scores For SVM
        sns.distplot(svm, hist=False, kde=True, kde_kws={'linewidth': 1}, label='SVM')
        # Plot Formatting
        plt.legend(bbox_to_anchor=(1, 1), loc=2, borderaxespad=0., title='Classifiers')
        #Title of the plot
        plt.title('Distribution of Accuracy scores\n' + title)
        #Label the x-axis
        plt.xlabel('Accuracy values')
        #Label the y-axis
        plt.ylabel('Density')
        #Save the plot | Uncomment to save the plot
        #plt.savefig('Accuracy'+ '_comparison.png', bbox_inches='tight')
        #Show the plot
        plt.show()
    #call to the plot pdf method if there are still values in the rf array
    plot_pdf()

